    const uploadTime = 2000;

    setUploadProgress(0);
    const interval = setInterval(() => {
      setUploadProgress((oldProgress) => {
        if (oldProgress === 100) {
          clearInterval(interval);
          onUploadCompleted(file.name);
          return 100;
        }
        return Math.min(oldProgress + 10, 100);
      });
    }, uploadTime / 10);
